import React, { useState } from "react";
import styled from "styled-components";

import Title from "./mypage/Title";
import UserInfo from "./mypage/UserInfo";
import BookmarkMenu from "./mypage/BookmarkMenu";
import BookmarkFolder from "./mypage/BookmarkFolder";
import BookmarkList from "./mypage/BookmarkList";

const Mypage = () => {

    return (
        <Wrapper>
            <Title />
            <UserInfo />
            <BookmarkMenu />
            <BookmarkFolder />
            <BookmarkList />
        </Wrapper>
    );
};

export default Mypage;

const Wrapper = styled.div`
display: flex;
justify-content: center; /* 수평 정렬 (가로 중앙 정렬) */

width: 100vw; /* 화면 너비의 100% */
height: 100vh; /* 화면 높이의 100% */
`;
